async () => {
		let apps = []; 
		let page = 1; 
		do{
			await list_all_dapps.run({page}); 
			if(list_all_dapps.data.details) break; 
			apps = [...apps, ...list_all_dapps.data.results]; 
			page++; 
		}while(list_all_dapps.data.next != null); 
		storeValue('dapps', apps); 
		storeValue(globalObj.FILTERED_APPS, apps); 
	}

